import { useState } from 'react';

function Register() {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    function handleChangeEmail(e) {
        setEmail(e.target.value);
    }

    function handleChangePassword(e) {
        setPassword(e.target.value);
    }

    return (
        <section className="sign">
            <div className="sign__container">
                <p className="sign__heading">Регистрация</p>
                <form className="sign__form">
                    <input
                        className="sign__input"
                        placeholder="Email"
                        required
                        value={email || ''}
                        onChange={handleChangeEmail}
                    />
                    <span className="sign__input-error"></span>
                    <input
                        className="sign__input"
                        placeholder="Пароль"
                        required
                        value={password || ''}
                        onChange={handleChangePassword}
                    />
                    <span className="sign__input-error"></span>
                    <button className="sign__button">Зарегистрироваться</button>
                </form>
                <p className="sign__question">Уже зарегистрированы? <button className="sign__question-button">Войти</button></p>
            </div>
        </section>
    )
}

export default Register;
